@testset "3.3 u (a+b log(c (d+e x)^n))^p" begin
    (a, b, c, d, e, f, g, h, i, j, m, n, p, q, x, ) = @variables a b c d e f g h i j m n p q x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*AF(x)*(a+b*log(c*(d+e*x)^n))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*log(c*(d+e*x))^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*log(c*(d+e*x))^p=#


    @test_int [log(c*(d + e*x))^4, x, 5, 24*x - (24*(d + e*x)*log(c*(d + e*x)))/e + (12*(d + e*x)*log(c*(d + e*x))^2)/e - (4*(d + e*x)*log(c*(d + e*x))^3)/e + ((d + e*x)*log(c*(d + e*x))^4)/e]
    @test_int [log(c*(d + e*x))^3, x, 4, -6*x + (6*(d + e*x)*log(c*(d + e*x)))/e - (3*(d + e*x)*log(c*(d + e*x))^2)/e + ((d + e*x)*log(c*(d + e*x))^3)/e]
    @test_int [log(c*(d + e*x))^2, x, 3, 2*x - (2*(d + e*x)*log(c*(d + e*x)))/e + ((d + e*x)*log(c*(d + e*x))^2)/e]
    @test_int [log(c*(d + e*x))^1, x, 2, -x + ((d + e*x)*log(c*(d + e*x)))/e]
    @test_int [1/log(c*(d + e*x))^1, x, 2, LogIntegral(c*(d + e*x))/(c*e)]
    @test_int [1/log(c*(d + e*x))^2, x, 3, -((d + e*x)/(e*log(c*(d + e*x)))) + LogIntegral(c*(d + e*x))/(c*e)]
    @test_int [1/log(c*(d + e*x))^3, x, 4, -((d + e*x)/(2*e*log(c*(d + e*x))^2)) - (d + e*x)/(2*e*log(c*(d + e*x))) + LogIntegral(c*(d + e*x))/(2*c*e)]
    @test_int [1/log(c*(d + e*x))^4, x, 5, -((d + e*x)/(3*e*log(c*(d + e*x))^3)) - (d + e*x)/(6*e*log(c*(d + e*x))^2) - (d + e*x)/(6*e*log(c*(d + e*x))) + LogIntegral(c*(d + e*x))/(6*c*e)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*log(c*(d+e*x))^(p/2)=#


    @test_int [log(c*(d + e*x))^(5/2), x, 7, -((15*sqrt(pi)*erfi(sqrt(log(c*(d + e*x)))))/(8*c*e)) + (15*(d + e*x)*sqrt(log(c*(d + e*x))))/(4*e) - (5*(d + e*x)*log(c*(d + e*x))^(3/2))/(2*e) + ((d + e*x)*log(c*(d + e*x))^(5/2))/e]
    @test_int [log(c*(d + e*x))^(3/2), x, 6, (3*sqrt(pi)*erfi(sqrt(log(c*(d + e*x)))))/(4*c*e) - (3*(d + e*x)*sqrt(log(c*(d + e*x))))/(2*e) + ((d + e*x)*log(c*(d + e*x))^(3/2))/e]
    @test_int [log(c*(d + e*x))^(1/2), x, 5, -((sqrt(pi)*erfi(sqrt(log(c*(d + e*x)))))/(2*c*e)) + ((d + e*x)*sqrt(log(c*(d + e*x))))/e]
    @test_int [1/log(c*(d + e*x))^(1/2), x, 4, (sqrt(pi)*erfi(sqrt(log(c*(d + e*x)))))/(c*e)]
    @test_int [1/log(c*(d + e*x))^(3/2), x, 5, (2*sqrt(pi)*erfi(sqrt(log(c*(d + e*x)))))/(c*e) - (2*(d + e*x))/(e*sqrt(log(c*(d + e*x))))]
    @test_int [1/log(c*(d + e*x))^(5/2), x, 6, (4*sqrt(pi)*erfi(sqrt(log(c*(d + e*x)))))/(3*c*e) - (2*(d + e*x))/(3*e*log(c*(d + e*x))^(3/2)) - (4*(d + e*x))/(3*e*sqrt(log(c*(d + e*x))))]
    @test_int [1/log(c*(d + e*x))^(7/2), x, 7, (8*sqrt(pi)*erfi(sqrt(log(c*(d + e*x)))))/(15*c*e) - (2*(d + e*x))/(5*e*log(c*(d + e*x))^(5/2)) - (4*(d + e*x))/(15*e*log(c*(d + e*x))^(3/2)) - (8*(d + e*x))/(15*e*sqrt(log(c*(d + e*x))))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*log(c*(d+e*x))^p*with*p*symbolic=#


    @test_int [log(c*(d + e*x))^p, x, 3, (Gamma(1 + p, -log(c*(d + e*x)))*log(c*(d + e*x))^p)/((-log(c*(d + e*x)))^p*(c*e))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*log(c*(d+e*x)^n))^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(a+b*log(c*(d+e*x)^n))^p=#


    @test_int [(a + b*log(c*(d + e*x)^n))^4, x, 6, -24*a*b^3*n^3*x + 24*b^4*n^4*x - (24*b^4*n^3*(d + e*x)*log(c*(d + e*x)^n))/e + (12*b^2*n^2*(d + e*x)*(a + b*log(c*(d + e*x)^n))^2)/e - (4*b*n*(d + e*x)*(a + b*log(c*(d + e*x)^n))^3)/e + ((d + e*x)*(a + b*log(c*(d + e*x)^n))^4)/e]
    @test_int [(a + b*log(c*(d + e*x)^n))^3, x, 5, 6*a*b^2*n^2*x - 6*b^3*n^3*x + (6*b^3*n^2*(d + e*x)*log(c*(d + e*x)^n))/e - (3*b*n*(d + e*x)*(a + b*log(c*(d + e*x)^n))^2)/e + ((d + e*x)*(a + b*log(c*(d + e*x)^n))^3)/e]
    @test_int [(a + b*log(c*(d + e*x)^n))^2, x, 4, -2*a*b*n*x + 2*b^2*n^2*x - (2*b^2*n*(d + e*x)*log(c*(d + e*x)^n))/e + ((d + e*x)*(a + b*log(c*(d + e*x)^n))^2)/e]
    @test_int [(a + b*log(c*(d + e*x)^n))^1, x, 3, a*x - b*n*x + (b*(d + e*x)*log(c*(d + e*x)^n))/e]
    @test_int [1/(a + b*log(c*(d + e*x)^n))^1, x, 3, ((d + e*x)*ExpIntegralEi((a + b*log(c*(d + e*x)^n))/(b*n)))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(b*e*n))]
    @test_int [1/(a + b*log(c*(d + e*x)^n))^2, x, 4, ((d + e*x)*ExpIntegralEi((a + b*log(c*(d + e*x)^n))/(b*n)))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(b^2*e*n^2)) - (d + e*x)/(b*e*n*(a + b*log(c*(d + e*x)^n)))]
    @test_int [1/(a + b*log(c*(d + e*x)^n))^3, x, 5, ((d + e*x)*ExpIntegralEi((a + b*log(c*(d + e*x)^n))/(b*n)))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(2*b^3*e*n^3)) - (d + e*x)/(2*b*e*n*(a + b*log(c*(d + e*x)^n))^2) - (d + e*x)/(2*b^2*e*n^2*(a + b*log(c*(d + e*x)^n)))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(a+b*log(c*(d+e*x)^n))^(p/2)=#


    @test_int [(a + b*log(c*(d + e*x)^n))^(5/2), x, 7, -((15*b^(5/2)*n^(5/2)*sqrt(pi)*(d + e*x)*erfi(sqrt(a + b*log(c*(d + e*x)^n))/(sqrt(b)*sqrt(n))))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(8*e))) + (15*b^2*n^2*(d + e*x)*sqrt(a + b*log(c*(d + e*x)^n)))/(4*e) - (5*b*n*(d + e*x)*(a + b*log(c*(d + e*x)^n))^(3/2))/(2*e) + ((d + e*x)*(a + b*log(c*(d + e*x)^n))^(5/2))/e]
    @test_int [(a + b*log(c*(d + e*x)^n))^(3/2), x, 6, (3*b^(3/2)*n^(3/2)*sqrt(pi)*(d + e*x)*erfi(sqrt(a + b*log(c*(d + e*x)^n))/(sqrt(b)*sqrt(n))))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(4*e)) - (3*b*n*(d + e*x)*sqrt(a + b*log(c*(d + e*x)^n)))/(2*e) + ((d + e*x)*(a + b*log(c*(d + e*x)^n))^(3/2))/e]
    @test_int [(a + b*log(c*(d + e*x)^n))^(1/2), x, 5, -((sqrt(b)*sqrt(n)*sqrt(pi)*(d + e*x)*erfi(sqrt(a + b*log(c*(d + e*x)^n))/(sqrt(b)*sqrt(n))))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(2*e))) + ((d + e*x)*sqrt(a + b*log(c*(d + e*x)^n)))/e]
    @test_int [1/(a + b*log(c*(d + e*x)^n))^(1/2), x, 4, (sqrt(pi)*(d + e*x)*erfi(sqrt(a + b*log(c*(d + e*x)^n))/(sqrt(b)*sqrt(n))))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(sqrt(b)*e*sqrt(n)))]
    @test_int [1/(a + b*log(c*(d + e*x)^n))^(3/2), x, 5, (2*sqrt(pi)*(d + e*x)*erfi(sqrt(a + b*log(c*(d + e*x)^n))/(sqrt(b)*sqrt(n))))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(b^(3/2)*e*n^(3/2))) - (2*(d + e*x))/(b*e*n*sqrt(a + b*log(c*(d + e*x)^n)))]
    @test_int [1/(a + b*log(c*(d + e*x)^n))^(5/2), x, 6, (4*sqrt(pi)*(d + e*x)*erfi(sqrt(a + b*log(c*(d + e*x)^n))/(sqrt(b)*sqrt(n))))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(3*b^(5/2)*e*n^(5/2))) - (2*(d + e*x))/(3*b*e*n*(a + b*log(c*(d + e*x)^n))^(3/2)) - (4*(d + e*x))/(3*b^2*e*n^2*sqrt(a + b*log(c*(d + e*x)^n)))]
    @test_int [1/(a + b*log(c*(d + e*x)^n))^(7/2), x, 7, (8*sqrt(pi)*(d + e*x)*erfi(sqrt(a + b*log(c*(d + e*x)^n))/(sqrt(b)*sqrt(n))))/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(15*b^(7/2)*e*n^(7/2))) - (2*(d + e*x))/(5*b*e*n*(a + b*log(c*(d + e*x)^n))^(5/2)) - (4*(d + e*x))/(15*b^2*e*n^2*(a + b*log(c*(d + e*x)^n))^(3/2)) - (8*(d + e*x))/(15*b^3*e*n^3*sqrt(a + b*log(c*(d + e*x)^n)))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(a+b*log(c*(d+e*x)^n))^p*with*p*symbolic=#


    @test_int [(a + b*log(c*(d + e*x)^n))^p, x, 3, ((d + e*x)*Gamma(1 + p, -((a + b*log(c*(d + e*x)^n))/(b*n)))*(a + b*log(c*(d + e*x)^n))^p)/(ℯ^(a/(b*n))*(c*(d + e*x)^n)^n^(-1)*(-((a + b*log(c*(d + e*x)^n))/(b*n)))^p*e)]


    @test_int [(a + b*log(c*(d + e*x)^(1/2)))^p, x, 3, (Gamma(1 + p, -((2*(a + b*log(c*sqrt(d + e*x))))/b))*(a + b*log(c*sqrt(d + e*x)))^p)/(2^p*ℯ^((2*a)/b)*(-((a + b*log(c*sqrt(d + e*x)))/b))^p*(c^2*e))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(f+g*x)^q*(a+b*log(c*(d+e*x)^n))^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(f+g*x)^q*(a+b*log(c*(d+e*x)^n))^p*when*e*f-d*g=0=#


    @test_int [(e + f*x)^(p - 1)/log(d*(e + f*x)^p), x, 3, LogIntegral(d*(e + f*x)^p)/(d*f*p)]
    @test_int [(e*g + f*g*x)^(p - 1)/log(d*(e + f*x)^p), x, 4, ((e + f*x)^(1 - p)*(g*(e + f*x))^(-1 + p)*LogIntegral(d*(e + f*x)^p))/(d*f*p)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(f+g*x)^q*(a+b*log(c*(d+e*x)^n))^p=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(a + b*log(c*(d + e*x)^n))*(f + g*x)^4, x, 3, -((b*(e*f - d*g)^4*n*x)/(5*e^4)) - (b*(e*f - d*g)^3*n*(f + g*x)^2)/(10*e^3*g) - (b*(e*f - d*g)^2*n*(f + g*x)^3)/(15*e^2*g) - (b*(e*f - d*g)*n*(f + g*x)^4)/(20*e*g) - (b*n*(f + g*x)^5)/(25*g) - (b*(e*f - d*g)^5*n*log(d + e*x))/(5*e^5*g) + ((f + g*x)^5*(a + b*log(c*(d + e*x)^n)))/(5*g)]
    @test_int [(a + b*log(c*(d + e*x)^n))*(f + g*x)^3, x, 3, -((b*(e*f - d*g)^3*n*x)/(4*e^3)) - (b*(e*f - d*g)^2*n*(f + g*x)^2)/(8*e^2*g) - (b*(e*f - d*g)*n*(f + g*x)^3)/(12*e*g) - (b*n*(f + g*x)^4)/(16*g) - (b*(e*f - d*g)^4*n*log(d + e*x))/(4*e^4*g) + ((f + g*x)^4*(a + b*log(c*(d + e*x)^n)))/(4*g)]
    @test_int [(a + b*log(c*(d + e*x)^n))*(f + g*x)^2, x, 3, -((b*(e*f - d*g)^2*n*x)/(3*e^2)) - (b*(e*f - d*g)*n*(f + g*x)^2)/(6*e*g) - (b*n*(f + g*x)^3)/(9*g) - (b*(e*f - d*g)^3*n*log(d + e*x))/(3*e^3*g) + ((f + g*x)^3*(a + b*log(c*(d + e*x)^n)))/(3*g)]
    @test_int [(a + b*log(c*(d + e*x)^n))*(f + g*x)^1, x, 3, -((b*(e*f - d*g)*n*x)/(2*e)) - (b*n*(f + g*x)^2)/(4*g) - (b*(e*f - d*g)^2*n*log(d + e*x))/(2*e^2*g) + ((f + g*x)^2*(a + b*log(c*(d + e*x)^n)))/(2*g)]
    @test_int [(a + b*log(c*(d + e*x)^n))*(f + g*x)^0, x, 3, a*x - b*n*x + (b*(d + e*x)*log(c*(d + e*x)^n))/e]
    @test_int [(a + b*log(c*(d + e*x)^n))/(f + g*x)^1, x, 3, ((a + b*log(c*(d + e*x)^n))*log((e*(f + g*x))/(e*f - d*g)))/g + (b*n*PolyLog(2, -((g*(d + e*x))/(e*f - d*g))))/g]
    @test_int [(a + b*log(c*(d + e*x)^n))/(f + g*x)^2, x, 4, (b*e*n*log(d + e*x))/(g*(e*f - d*g)) - (a + b*log(c*(d + e*x)^n))/(g*(f + g*x)) - (b*e*n*log(f + g*x))/(g*(e*f - d*g))]
    @test_int [(a + b*log(c*(d + e*x)^n))/(f + g*x)^3, x, 3, (b*e*n)/(2*g*(e*f - d*g)*(f + g*x)) + (b*e^2*n*log(d + e*x))/(2*g*(e*f - d*g)^2) - (a + b*log(c*(d + e*x)^n))/(2*g*(f + g*x)^2) - (b*e^2*n*log(f + g*x))/(2*g*(e*f - d*g)^2)]
    @test_int [(a + b*log(c*(d + e*x)^n))/(f + g*x)^4, x, 3, (b*e*n)/(6*g*(e*f - d*g)*(f + g*x)^2) + (b*e^2*n)/(3*g*(e*f - d*g)^2*(f + g*x)) + (b*e^3*n*log(d + e*x))/(3*g*(e*f - d*g)^3) - (a + b*log(c*(d + e*x)^n))/(3*g*(f + g*x)^3) - (b*e^3*n*log(f + g*x))/(3*g*(e*f - d*g)^3)]


    @test_int [(a + b*log(c*(d + e*x)^n))^2*(f + g*x)^3, x, 8, (2*b^2*(e*f - d*g)^3*n^2*x)/e^3 + (3*b^2*g*(e*f - d*g)^2*n^2*(d + e*x)^2)/(4*e^4) + (2*b^2*g^2*(e*f - d*g)*n^2*(d + e*x)^3)/(9*e^4) + (b^2*g^3*n^2*(d + e*x)^4)/(32*e^4) + (b^2*(e*f - d*g)^4*n^2*log(d + e*x)^2)/(4*e^4*g) - (2*b*(e*f - d*g)^3*n*(d + e*x)*(a + b*log(c*(d + e*x)^n)))/e^4 - (3*b*g*(e*f - d*g)^2*n*(d + e*x)^2*(a + b*log(c*(d + e*x)^n)))/(2*e^4) - (2*b*g^2*(e*f - d*g)*n*(d + e*x)^3*(a + b*log(c*(d + e*x)^n)))/(3*e^4) - (b*g^3*n*(d + e*x)^4*(a + b*log(c*(d + e*x)^n)))/(8*e^4) - (b*(e*f - d*g)^4*n*log(d + e*x)*(a + b*log(c*(d + e*x)^n)))/(2*e^4*g) + ((f + g*x)^4*(a + b*log(c*(d + e*x)^n))^2)/(4*g)]
    @test_int [(a + b*log(c*(d + e*x)^n))^2*(f + g*x)^2, x, 8, (2*b^2*(e*f - d*g)^2*n^2*x)/e^2 + (b^2*g*(e*f - d*g)*n^2*(d + e*x)^2)/(2*e^3) + (2*b^2*g^2*n^2*(d + e*x)^3)/(27*e^3) + (b^2*(e*f - d*g)^3*n^2*log(d + e*x)^2)/(3*e^3*g) - (2*b*(e*f - d*g)^2*n*(d + e*x)*(a + b*log(c*(d + e*x)^n)))/e^3 - (b*g*(e*f - d*g)*n*(d + e*x)^2*(a + b*log(c*(d + e*x)^n)))/e^3 - (2*b*g^2*n*(d + e*x)^3*(a + b*log(c*(d + e*x)^n)))/(9*e^3) - (2*b*(e*f - d*g)^3*n*log(d + e*x)*(a + b*log(c*(d + e*x)^n)))/(3*e^3*g) + ((f + g*x)^3*(a + b*log(c*(d + e*x)^n))^2)/(3*g)]
    @test_int [(a + b*log(c*(d + e*x)^n))^2*(f + g*x)^1, x, 9, -((2*a*b*(e*f - d*g)*n*x)/e) + (2*b^2*(e*f - d*g)*n^2*x)/e + (b^2*g*n^2*(d + e*x)^2)/(4*e^2) - (2*b^2*(e*f - d*g)*n*(d + e*x)*log(c*(d + e*x)^n))/e^2 - (b*g*n*(d + e*x)^2*(a + b*log(c*(d + e*x)^n)))/(2*e^2) + ((e*f - d*g)*(d + e*x)*(a + b*log(c*(d + e*x)^n))^2)/e^2 + (g*(d + e*x)^2*(a + b*log(c*(d + e*x)^n))^2)/(2*e^2)]
    @test_int [(a + b*log(c*(d + e*x)^n))^2*(f + g*x)^0, x, 4, -2*a*b*n*x + 2*b^2*n^2*x - (2*b^2*n*(d + e*x)*log(c*(d + e*x)^n))/e + ((d + e*x)*(a + b*log(c*(d + e*x)^n))^2)/e]
    @test_int [(a + b*log(c*(d + e*x)^n))^2/(f + g*x)^1, x, 4, ((a + b*log(c*(d + e*x)^n))^2*log((e*(f + g*x))/(e*f - d*g)))/g + (2*b*n*(a + b*log(c*(d + e*x)^n))*PolyLog(2, -((g*(d + e*x))/(e*f - d*g))))/g - (2*b^2*n^2*PolyLog(3, -((g*(d + e*x))/(e*f - d*g))))/g]
